from math import isqrt
def primeFactors(n):
    x=[]
    while n % 2 == 0:
        x.append(2)
        n //= 2
    for i in range(3,isqrt(n)+1,2):
        while n % i == 0:
            x.append(i)
            n //= i
    if n > 2:
        x.append(n)
    if len(x)==0:
        x.append(1)
    if len(x)!=1:
        y=x[-1]-x[0]
    else:
        y=x[0]
    return y
